describe("commands",function(){describe("when executing a command",function(){var e,n;beforeEach(function(){e=new Wreqr.Commands,e.setHandler("do:it",function(){return"some value"}),n=e.execute("do:it")}),it("should not return any value",function(){expect(n).toBeUndefined()})}),describe("when executing a command with a parameter",function(){var e,n,t;beforeEach(function(){e=new Wreqr.Commands,e.setHandler("do:it",function(e){t=e}),n=e.execute("do:it","foo")}),it("should pass the param along",function(){expect(t).toBe("foo")})}),describe("when executing with multiple parameters",function(){var e,n,t;beforeEach(function(){e=new Wreqr.Commands,e.setHandler("do:it",function(e,o){n=e,t=o}),e.execute("do:it","foo","bar")}),it("should pass the param along",function(){expect(n).toBe("foo"),expect(t).toBe("bar")})})});